  false,\n\t\"url\": null,\n\t\"notes\": \"This image represents a LiDAR (Light Detection
  &amp; Ranging) 0.3x0.3 meter resolution depth surface for Fish Bay, St. John in
  the U.S. Virgin Islands (USVI). The image's horizontal coordinate system is NAD83
  UTM 20 North. Fugro LADS, funded by the National Oceanic &amp; Atmospheric Administration
  (NOAA) , acquired bathymetry and relative seafloor reflectivity between 1/29/2011
  - 2/28/2011. Bathymetry and reflectivity data were acquired using a LADS (Laser
  Airborne Depth Sounder) Mark II Airborne System from altitudes between 1,200 and
  2,200ft at ground speeds between 140 and 175 knots. The 900 Hertz Nd: YAG (neodymium-doped
  yttrium aluminum garnet) laser (1064 nm) acquired 3x3 meter spot spacing and 200%
  seabed coverage. Depths between 3 and 40 m were surveyed, producing a 3x3 m bathymetry
  and 3x3 m reflectivity surface. These surfaces were resampled to 0.3x0.3 m to match
  the spatial resolution of the orthophotos collected by the U.S. Army Corps of Engineers
  in 2012. Environmental factors such as wind strength and direction, cloud cover,
  water clarity and depth influenced the area of data acquisition on a daily basis.
  The data was processed using the LADS Mark II Ground System and data visualization,
  quality control and final products were created using CARIS HIPS and SIPS and CARIS
  BASE Editor. All users should individually evaluate the suitability of this data
  according to their own needs and standards.\",\n\t\"license_title\": null,\n\t\"extras\":
